import React from 'react';

class Navigation extends React.Component {
    constructor() {
        super();
        this.state = {

        }
    }

    render() {
        return (
            <div className="navigation">
                <div className="container">
                    <div className="inside">
                        <div className="nav nav-tab menu">
                            <a href="#settings" data-toggle="tab" title="User Setting" className="">
                                <i class="ti-panel"></i>
                                Setting
                            </a>
                            <a href="#members" data-toggle="tab" title="All members" class="active show">
                                <i class="ti-home active"></i>
                                All Friends
                            </a>
                            <a href="#discussions" data-toggle="tab" class="" title="Chat">
                                <i class="ti-comment-alt"></i>
                                Recent Chat
                            </a>
                            <a href="#notifications" data-toggle="tab" class="f-grow1" title="Notifications">
                                <i class="ti-bell"></i>
                                Notifications
                            </a>
                            <a href="#sign-in.html" class="btn power" title="Sign Out"><i class="ti-power-off"></i></a>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Navigation;
